import * as React from 'react';
import Box from '@mui/joy/Box';
import Drawer from '@mui/joy/Drawer';
import AddIcon from '@mui/icons-material/Add';
import {Button} from "@mui/material";
import {Alert, ModalClose, Snackbar} from "@mui/joy";
import DialogTitle from "@mui/material/DialogTitle";
import MuiAlert from '@mui/material/Alert';
import TextField from "@mui/material/TextField";
import {useState} from "react";
export default function AddEventDrawer() {
    const [open, setOpen] = React.useState(false);
    const [openSnackbar, setOpenSnackbar] = React.useState(false);

    const Alert = React.forwardRef(function Alert(props, ref) {
        return <MuiAlert elevation={6} ref={ref} variant="filled" {...props} />;
    });

    const handleClick = () => {
        setOpenSnackbar(true);
    };

    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpenSnackbar(false);
    };

    const toggleDrawer = (inOpen) => (event) => {
        if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
            return;
        }

        setOpen(inOpen);
    };

    const [textInputs, setTextInputs] = useState({
        textInput1: '',
        textInput2: '',
        textInput3: '',
    });

    const [selectedDate, setSelectedDate] = useState(null);
    const [selectedTime, setSelectedTime] = useState(null);

    const handleTextChange = (e) => {
        const { name, value } = e.target;
        setTextInputs((prevInputs) => ({
            ...prevInputs,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle form submission here
        const formData = {
            ...textInputs,
            selectedDate,
            selectedTime,
        };
        console.log(formData);
    };

    return (
        <Box sx={{ display: 'flex' }}>
            <Button variant="contained" startIcon={<AddIcon />} onClick={toggleDrawer(true)}>
                New event
            </Button>
            <Snackbar open={openSnackbar} autoHideDuration={6000} onClose={handleClose}>
                <Alert onClose={handleClose} severity="success" sx={{ width: '100%' }}>
                    Event created successfully!
                </Alert>
            </Snackbar>
            <Drawer anchor="right" open={open} onClose={() => setOpen(false)}>
                <ModalClose/>
                <DialogTitle>New event</DialogTitle>
                <Box
                    role="presentation"
                    onClick={toggleDrawer(false)}
                    onKeyDown={toggleDrawer(false)}
                >
                    <form onSubmit={handleSubmit}>
                        <TextField
                            name="textInput1"
                            label="Text Input 1"
                            value={textInputs.textInput1}
                            onChange={handleTextChange}
                            fullWidth
                            margin="normal"
                        />
                        <TextField
                            name="textInput2"
                            label="Text Input 2"
                            value={textInputs.textInput2}
                            onChange={handleTextChange}
                            fullWidth
                            margin="normal"
                        />
                        <TextField
                            name="textInput3"
                            label="Text Input 3"
                            value={textInputs.textInput3}
                            onChange={handleTextChange}
                            fullWidth
                            margin="normal"
                        />
                        <LocalizationProvider dateAdapter={AdapterDateFns}>
                            <KeyboardDatePicker
                                name="dateInput"
                                label="Date"
                                value={selectedDate}
                                onChange={(newDate) => setSelectedDate(newDate)}
                                format="MM/dd/yyyy"
                                fullWidth
                                margin="normal"
                            />
                            <KeyboardTimePicker
                                name="timeInput"
                                label="Time"
                                value={selectedTime}
                                onChange={(newTime) => setSelectedTime(newTime)}
                                fullWidth
                                margin="normal"
                            />
                        </LocalizationProvider>
                        <Button type="submit" variant="contained" color="primary">
                            Submit
                        </Button>
                    </form>
                </Box>
            </Drawer>
        </Box>
    );
}
